import React from "react";

const CommentCard = props => {
  const { date, author, body, votes } = props;
  return (
    <>
      <li className="comment">
        <p>{body}</p>
        <div className="comment_header">
          <p>{date}</p>
          <p>{author}</p>
          <p>{votes}</p>
        </div>
      </li>
    </>
  );
};

export default CommentCard;
